var cases = []

for(var i=1; i<3; ++i) {
  for(var j=1; j<=i; ++j) {
    var nr = Math.pow(10, i)
    var nb = Math.pow(10, j)
    var red = []
    for(var k=0; k<nr; ++k) {
      red.push([
          [Math.random(), Math.random()],
          [Math.random(), Math.random()]
        ])
    }
    var blue = []
    for(var k=0; k<nb; ++k) {
      blue.push([
          [Math.random(), Math.random()],
          [Math.random(), Math.random()]
        ])
    }
    cases.push({
      name: "Random, red: " + nr + ", blue: " + nb,
      red: red,
      blue: blue
    })
  }
}

function clipperToGraph(loops) {
  var edges = []
  for(var i=0; i<loops.length; ++i) {
    var loop = loops[i]
    for(var j=0; j<loop.length; ++j) {
      var a = loop[j]
      var b = loop[(j+1)%loop.length]
      if(a.X === b.X && a.Y === b.Y) {
        continue
      }
      edges.push([
        [a.X, a.Y],
        [b.X, b.Y]
      ])
    }
  }
  return edges
}

